package com.leetcode.strings;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class FindAllAnagramsInStrings {

    public static void main(String[] args) {
        FindAllAnagramsInStrings obj=new FindAllAnagramsInStrings();
        String s = "",
                p = "";
        List<Integer> anagrams = obj.findAnagrams(s, p);
        System.out.println(anagrams);

    }

    public List<Integer> findAnagrams(String s, String p) {


        List<Integer> res=new ArrayList<>();
        if(s.length() < p.length()) return res;

        Map<Character,Integer> patternMap=new HashMap<>();
        Map<Character,Integer> wordMap=new HashMap<>();

        for(char ch : p.toCharArray()){
            patternMap.put(ch,patternMap.getOrDefault(ch,0)+1);
        }

        for(int i=0;i<p.length()-1;i++){
            char ch=s.charAt(i);
            wordMap.put(ch,wordMap.getOrDefault(ch,0)+1);
        }

        for(int i=p.length()-1,j=0;i<s.length();i++,j++){
            char ch=s.charAt(i);
            wordMap.put(ch,wordMap.getOrDefault(ch,0)+1);

            if(compare(wordMap,patternMap)) {
                res.add(j);
            }

            char removeChar=s.charAt(j);
            int freq=wordMap.get(removeChar);
            if(freq==1){
                wordMap.remove(removeChar);
            }else{
                wordMap.put(removeChar,freq-1);
            }
        }
        return res;
    }

    private boolean compare(Map<Character,Integer> wordMap,Map<Character,Integer> patternMap){
        for(char ch : patternMap.keySet()){
            if(!wordMap.containsKey(ch) ||  wordMap.get(ch)!=patternMap.get(ch)){
                return false;
            }
        }
        return true;
    }
}
